            [description] => 登録数＝その日にゲームを始めたアカウント数
課金数＝登録数の中で課金アカウント数
※課金数は抽出日によって、増加する
            [sql_text] => select 
    newuser.d as '登録日',
    newuser.cnt as '登録数',
    ifnull(0,payment.cnt)  as '課金数'
from 
(
    select left(created,10) as d,count(*) as cnt
    from t_members
    where
        created > '2015-05-01 00:00:00'
    group by left(created,10)
) as newuser
left join
(
    select left(created,10) as d,count(*) cnt
    from 
      (
        select id,created from t_members
        where
            created > '2015-05-01 00:00:00'
      ) as t1
    where
    exists (
        select * from l_member_payments t2
        where t1.id=t2.t_member_id
    )
    group by left(created,10)
) as payment
on 
newuser.d = payment.d

