            [sql_text] => select
  platform, 
  count(t_member_id) as ActiveID 
from
  ( 
    select
      t1.t_member_id, 
      t2.platform      
    from
      suj_db2.l_member_logins as t1
	left join suj_db2.t_members as t2 on t1.t_member_id = t2.id
    where
    @1
    group by
      t1.t_member_id
  ) as t3 
group by platform;
